import "./App.css";
import { React } from "react";
import beach from './images/waldo-beach.webp'

function App() {
  return (
    <div>
      <h1>Home page</h1>
      <ul className="allLevels">
        <li>{beach}</li>
        <li>Level Two</li>
        <li>Level Three</li>
      </ul>
    </div>
  );
}

export default App;
